function makegl_Sphere(radius, sectorCount, stackCount) {
  var vertices = [];

  var x, y, z, xy; // vertex position
  var nx, ny, nz; // vertex normal
  var lengthInv = 1.0 / radius; // vertex normal
  var s, t; // vertex texCoord

  var sectorStep = (2 * Math.PI) / sectorCount;
  var stackStep = Math.PI / stackCount;
  var sectorAngle, stackAngle;

  for (let i = 0; i <= stackCount; i++) {
    stackAngle = Math.PI / 2 - i * stackStep; // starting from pi/2 to -pi/2
    xy = radius * Math.cos(stackAngle); // r * cos(u)
    z = radius * Math.sin(stackAngle); // r * sin(u)

    // add (sectorCount+1) vertices per stack
    // first and last vertices have same position and normal, but different tex coords

    for (let j = 0; j < sectorCount; j++) {
      sectorAngle = j * sectorStep; // starting from 0 to 2pi

      // push vertex position (x, y, z)
      x = xy * Math.cos(sectorAngle); // r * cos(u) * cos(v)
      y = xy * Math.sin(sectorAngle); // r * cos(u) * sin(v)
      vertices.push(x);
      vertices.push(y);
      vertices.push(z);

      // push normalized vertex normal (nx, ny, nz)
      nx = x * lengthInv;
      ny = y * lengthInv;
      nz = z * lengthInv;
      vertices.push(nx);
      vertices.push(ny);
      vertices.push(nz);

      // push colours
      vertices.push(0);
      vertices.push(0);
      vertices.push(0);

      // psuh vertex tex coord (s, t) range between [0, 1]
      s = j / sectorCount;
      t = i / stackCount;
      vertices.push(s);
      vertices.push(t);
    }
  }

  var indices = [];
  var lineIndices = [];
  var k1, k2;

  for (let i = 0; i < stackCount; i++) {
    k1 = i * (sectorCount + 1); // beginning of current stack
    k2 = k1 + sectorCount + 1; // beginning of next stack

    for (let j = 0; j < sectorCount; j++, k1++, k2++) {
      // 2 triangles per sector excluding first and last stacks
      // k1 => k2 => k1+1

      indices.push(k1);
      indices.push(k2);
      indices.push(k1 + 1);

      // k1+1 => k2 => k2+1
      indices.push(k1 + 1);
      indices.push(k2);
      indices.push(k2 + 1);
    }
  }

  console.log(indices);
  return { vertex: vertices, index: indices };
}

function Rastorise(vertexList, indexList) {
  const vertexsList = [];
  for (let index = 0; index < vertexList.length; index += 11) {
    var vertex = {
      v: [vertexList[index + 0], vertexList[index + 1], vertexList[index + 2]],
      vn: [vertexList[index + 3], vertexList[index + 4], vertexList[index + 5]],
      colour: [
        vertexList[index + 6],
        vertexList[index + 7],
        vertexList[index + 8],
      ],
      vt: [vertexList[index + 9], vertexList[index + 10]],
    };

    vertexsList.push(vertex);
  }

  const indexsList = [];
  for (let index = 0; index < indexList.length; index++) {
    var indexs = [
      indexList[index + 0],
      indexList[index + 1],
      indexList[index + 2],
    ];

    indexsList.push(indexs);
  }

  return { vertexs: vertexsList, indexs: indexsList };
}

function UnRastorise(Rastorised_object) {
  const vertexes = [];
  for (let index = 0; index < Rastorised_object.vertexs.length; index++) {
    vertexes.push(Rastorised_object.vertexs[index].v[0]);
    vertexes.push(Rastorised_object.vertexs[index].v[1]);
    vertexes.push(Rastorised_object.vertexs[index].v[2]);
    vertexes.push(Rastorised_object.vertexs[index].vn[0]);
    vertexes.push(Rastorised_object.vertexs[index].vn[1]);
    vertexes.push(Rastorised_object.vertexs[index].vn[2]);
    vertexes.push(Rastorised_object.vertexs[index].colour[0]);
    vertexes.push(Rastorised_object.vertexs[index].colour[1]);
    vertexes.push(Rastorised_object.vertexs[index].colour[2]);
    vertexes.push(Rastorised_object.vertexs[index].vt[0]);
    vertexes.push(Rastorised_object.vertexs[index].vt[1]);
  }
  const indexes = [];
  for (let index = 0; index < Rastorised_object.indexs.length; index++) {
    indexes.push(Rastorised_object.indexs[index][0]);
    indexes.push(Rastorised_object.indexs[index][1]);
    indexes.push(Rastorised_object.indexs[index][2]);
  }

  return { vertex: vertexes, index: indexes };
}

function find_max(indexList) {
  var most = 0;
  for (let index = 0; index < indexList.length; index++) {
    if (most < indexList[index]) {
      most = indexList[index];
    }
  }
  return most;
}

function removeDuplicates(data) {
  return [...new Set(data)];
}

