function scaleDownModel(model, scale) {
  var newmodel = Rastorise(model.vertex, model.index);

  for (let index = 0; index < newmodel.vertexs.length; index++) {
    newmodel.vertexs[index].v[0] *= scale;
    newmodel.vertexs[index].v[1] *= scale;
    newmodel.vertexs[index].v[2] *= scale;
  }

  return UnRastorise(newmodel);
}
